import {Rnd} from 'react-rnd';
import axios from 'axios';
import TextList from './builder/TextList';
import g from 'react-scale-text';
import NavBar from './components/NavBar';
import Blocks from './blocks/blocks'
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import ImageList from './builder/ImageList'
import SvgList from './builder/SvgList'
import PixabaySearch from './assets/Asset-Load';
import MainMenu from './menu/MainMenu';



function App() {
  return (
    <div className="app-container">
      <MainMenu />
      {/* Routes example */}
      <Routes>
        <Route path="/save-load">
          {/* Component for /save-load route */}
        </Route>
        <Route path="/components">
          {/* Component for /components route */}
        </Route>
        <Route path="/assets" element={<PixabaySearch />} />
        <Route path="/databases">
          {/* Component for /databases route */}
        </Route>
        <Route path="/graphics">
          {/* Component for /graphics route */}
        </Route>
        <Route path="/analytics">
          {/* Component for /analytics route */}
        </Route>
        <Route path="/sign-out">
          {/* Component for /sign-out route */}
        </Route>
      </Routes>
    </div>
  );
}

export default App;
